import { IoClose } from 'react-icons/io5';

const List = ({ items }) => {
    return (
        <ul>
            <article>
                <ul className = "bg-gray-100 mx-20 p-5 rounded-lg mt-10">
                    {items.map(({id, title}) => (
                        <ul className="flex items-center justify-between border-b-2">
                            <li key={id} className="text-black py-2 tracking-wider">{title}</li>
                            <button className="text-1xl"><IoClose className="text-gray"/></button>
                        </ul>
                    ))}
                </ul>
            </article>
        </ul>
    )
}

export default List
